import React from "react";

function Navbar(){
    return(
        <nav>
            <ul className="nav nav-tabs">
                <li className="active">
                    <a href="#home">Home</a>
                </li>
                <li>
                    <a href="#about">About</a>
                </li>
                <li>
                    <a href="#contact">Contact</a>
                </li>
            </ul>
        </nav>
    )
}


export default Navbar;
